import React from 'react';
import { Progress, Card } from 'antd';
import '../../styles/Dashboard.css'; // Import your styles here

const Dashboard = () => {
  return (
    <div className="dashboard">
      {/* Energy Summary Section */}
      <div className="energy-summary">
        <Card className="energy-card" bordered={false}>
          <Progress
            type="circle"
            percent={50}
            strokeColor="#5E5CE6"
            format={() => '938 Kcal'}
            width={80}
          />
          <p>Calorie consumed</p>
        </Card>
        <Card className="energy-card" bordered={false}>
          <Progress
            type="circle"
            percent={50}
            strokeColor="#5E5CE6"
            format={() => '938 Kcal'}
            width={80}
          />
          <p>Calorie remaining</p>
        </Card>
      </div>

      {/* Macro Targets Section */}
      <div className="macro-targets">
        <Card className="macro-card" bordered={false}>
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={70}
          />
          <p>Protein</p>
        </Card>
        <Card className="macro-card" bordered={false}>
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={70}
          />
          <p>Net Carb</p>
        </Card>
        <Card className="macro-card" bordered={false}>
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={70}
          />
          <p>Fat</p>
        </Card>
      </div>
    </div>
  );
};

export default Dashboard;
